import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  Container,
  Text,
  CaptionText,
  CommandButton,
  PrimaryButton,
  SearchInput,
  OutlinedButton,
  ActionButton,
  IconButton,
  Header,
  SubHeader,
  SubText,
  NormalText,
} from "../../styledComponents";
import styled from "styled-components";
import MoreIcon from "@material-ui/icons/MoreHoriz";
import userPhoto from "../../../public/static/sandy.jpeg";
import { Avatar } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  small: {
    width: theme.spacing(4),
    height: theme.spacing(4),
    marginRight: 15,
  },
}));

const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  flex: 0.8;
  width: 100%;
  padding-top: 0px;
  padding-left: 110px;
  padding-bottom: 0px 110px;
  padding-right: 0px 110px;
`;
const SideContainer = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  flex: 0.2;
  background-color: white;
`;
const Card = styled(Container)`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  height: 90px;
  min-width: 220px;
  background-color: white;
  border-radius: 3px;
  padding: 15px;
  margin-right: 20px;
  margin-bottom: 20px;
`;
const ListItem = styled("Container")`
  display: flex;
  flex-direction: row;
  padding: 10px;
  background-color: white;
  border-radius: 3px;
  align-items: center;
  justify-content: space-between;
  margin-bottom: 10px;
`;
const TenantList = styled(Container)`
  flex-direction: row;
  padding: 10px;
  border-bottom-width: 0.5px;
  border-bottom-color: gray;
`;
const Dashboard = () => {
  const classes = useStyles();
  return (
    <Container flex={1} row>
      <Wrapper>
        <Container row customStyles={{ paddingTop: 40, paddingBottom: 20 }}>
          <SubHeader customStyles={{ marginRight: 10 }}>
            Welcome back,
          </SubHeader>

          <SubHeader customStyles={{ color: "#009688" }}>Rene La</SubHeader>
        </Container>
        <Container
          customStyles={{ paddingTop: 20, paddingBottom: 20 }}
          wrap
          row
        >
          <Card>
            <Container row space="space-between" center color="transparent">
              <CaptionText>Number of houses</CaptionText>
              <IconButton>
                <MoreIcon style={{ fontSize: 25, color: "#979a9a" }} />
              </IconButton>
            </Container>
            <Container color="transparent">
              <SubHeader customStyles={{ color: "#0078D4" }}>23</SubHeader>
            </Container>
          </Card>
          <Card>
            <Container row space="space-between" center color="transparent">
              <CaptionText>Number of Tenants</CaptionText>
              <IconButton>
                <MoreIcon style={{ fontSize: 25, color: "#979a9a" }} />
              </IconButton>
            </Container>
            <Container color="transparent">
              <SubHeader customStyles={{ color: "#009688" }}>10</SubHeader>
            </Container>
          </Card>
          <Card>
            <Container row space="space-between" center color="transparent">
              <CaptionText>Number of Tickets</CaptionText>
              <IconButton>
                <MoreIcon style={{ fontSize: 25, color: "#979a9a" }} />
              </IconButton>
            </Container>
            <Container color="transparent">
              <SubHeader customStyles={{ color: "#ED6161" }}>100</SubHeader>
            </Container>
          </Card>
        </Container>
        <Container flex={1} row>
          <Container
            flex={0.6}
            column
            customStyles={{ paddingLeft: 20, paddingRight: 20 }}
          >
            <Text customStyles={{ marginBottom: 20 }}>
              Latest created houses
            </Text>

            <ListItem>
              <Container flex={0.3} row center color="transparent">
                <Avatar src={userPhoto} className={classes.small} />
                <SubText>Barcelona</SubText>
              </Container>

              <SubText>AMZN</SubText>
              <SubText>456</SubText>
              <MoreIcon />
            </ListItem>
            <ListItem>
              <Container flex={0.3} row center color="transparent">
                <Avatar src={userPhoto} className={classes.small} />
                <SubText>Barcelona</SubText>
              </Container>

              <SubText>AMZN</SubText>
              <SubText>456</SubText>
              <MoreIcon />
            </ListItem>
            <ListItem>
              <Container flex={0.3} row center color="transparent">
                <Avatar src={userPhoto} className={classes.small} />
                <SubText>Barcelona</SubText>
              </Container>

              <SubText>AMZN</SubText>
              <SubText>456</SubText>
              <MoreIcon />
            </ListItem>
            <ListItem>
              <Container flex={0.3} row center color="transparent">
                <Avatar src={userPhoto} className={classes.small} />
                <SubText>Barcelona</SubText>
              </Container>

              <SubText>AMZN</SubText>
              <SubText>456</SubText>
              <MoreIcon />
            </ListItem>
          </Container>
          <Container
            flex={0.4}
            column
            color="transparent"
            customStyles={{ paddingRight: 10 }}
          >
            <Text customStyles={{ marginBottom: 20 }}>Recent tenants</Text>
            <Container
              flex={1}
              column
              color="white"
              customStyles={{ borderRadius: 3 }}
            >
              <TenantList>
                <Container flex={0.2} center middle>
                  <Avatar src={userPhoto} className={classes.small} />
                </Container>
                <Container column flex={0.6} middle>
                  <CaptionText>Rene La</CaptionText>
                  <NormalText>renela@gmail.com</NormalText>
                </Container>
                <Container flex={0.2} center middle>
                  <MoreIcon />
                </Container>
              </TenantList>
            </Container>
          </Container>
        </Container>
      </Wrapper>
      <SideContainer />
    </Container>
  );
};

export default Dashboard;
